import ExpenseItem from "./Componets/ExpenseItem";
import Dolls from "./Componets/Dolls";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  const dolls = [
    {
      name: "ken",
      price: 40,
      height: "6,1",
    },
    {
      name: "barbie",
      price: 100,
      height: "5,1",
    },
    {
      name: "joe",
      price: 30,
      height: "5'10",
    },
    {
      name: "sara",
      price: 70,
      height: "5,4",
    },
  ];

  return (
    <div>
      <h1>Jacobs react practice project</h1>
      <h2>Let's get started!</h2>

    </div>
  );
}

export default App;
